    Vector6d UR10Model::computeEEPose(const Vector6d &q)
    {
      Matrix4d H = computeFKJoint5(q);
      Vector6d X;
      X << H(0,3), H(1,3), H(2,3);
      X.block<3,1>(3,0) = H.block<3,3>(0,0).eulerAngles(0,1,2);

      return X;
    }


